import {
  Container,
  Row,
  Col,
  BreadcrumbItem,
  Breadcrumb,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button,
  Alert
} from "shards-react";
import SEO from "react-seo-component";
import Head from "next/head";

import PDFFile from "../../../common/PDFFile";
// Layout
import Layout from "../../../components/Layout";
import ResourcesLayout from "../../../resources-components/ResourcesLayout";

// Style for the onft icons
const liStyles = {
  display: "inline!important",
  paddingLeft: "50px"
};

const oLiStyles = {
  display: "inline"
};

const ulStyles = {
  listStyleType: "none",
  paddingTop: "15px"
};

import { BrowserView, MobileView } from "react-device-detect";

const ComputerScience = props => (
  <Layout>
    <SEO
      title={"Cape Computer Science Past Papers | CXC Spanish Online"}
      description={
        "Get the CAPE Computer Science past papers in PDF format for free, along with the offical past paper booklet."
      }
      pathname={""}
      siteLanguage={"en"}
      twitterUsername={"_rxheem"}
      author={"Raheem McDonald"}
      article={true}
      publishedDate={"Jan 13, 2020"}
      modifiedDate={new Date()}
    />

    <Container>
      <BrowserView>
        <Breadcrumb>
          <BreadcrumbItem>
            <a href="/">Home</a>
          </BreadcrumbItem>
          <BreadcrumbItem>
            <a href="/">Resources</a>
          </BreadcrumbItem>
          <BreadcrumbItem>
            <a href="/cape-papers">CAPE</a>
          </BreadcrumbItem>
          <BreadcrumbItem active>Computer Science</BreadcrumbItem>
        </Breadcrumb>
      </BrowserView>

      <MobileView>
        <Breadcrumb>
          <BreadcrumbItem>
            <a href="/">Home</a>
          </BreadcrumbItem>
          <BreadcrumbItem>
            <a href="/">...</a>
          </BreadcrumbItem>
          <BreadcrumbItem>
            <a href="/cape-papers">CAPE</a>
          </BreadcrumbItem>
          <BreadcrumbItem active>Computer Science</BreadcrumbItem>
        </Breadcrumb>
      </MobileView>

      <ResourcesLayout>
        <Card>
          <CardBody>
            <CardTitle>CAPE Computer Science Past Papers</CardTitle>
            <br />

            <PDFFile
              title="Free Download"
              href="https://dl.dropbox.com/s/uifq5ynywxvdga8/CAPE%20Computer%20Science%20Past%20Papers%20u1_U2%202005-2016.pdf?dl=0"
            />

            <Button href="/past-papers">All Past Papers &rarr;</Button>
          </CardBody>
        </Card>
      </ResourcesLayout>
    </Container>
  </Layout>
);

export default ComputerScience;
